query {
  continents {
    code
    name
    countries {
      code
      name
      capital
    }
  }
}

query {
  continents(filter: {code: {eq: "NA' UNION SELECT SLEEP(5)--"}}) {
    code
    name
  }
}

query {
  continents {
    code
    countries {
      code
      name
      languages {
        native
      }
    }
  }
}

query {
  s: continents {
    c1: code
    c2: countries {
      c3: code
      n: name
      l: languages {
        r: rtl
      }
    }
  }
}

query {
  continents {
    types {
      name
      fields {
        name
        type {
          name
          ofType {
            name
          }
        }
      }
    }
  }
}
